"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["7963"],{20927(A){A.exports=JSON.parse('{"name":"BunnyCDN Cache Purge","slug":"bunnycdn-cache-purge","url":"https://codeberg.org/bentasker/woodpecker-ci-bunnycdn-cache-flush","icon":"https://codeberg.org/bentasker/woodpecker-ci-bunnycdn-cache-flush/raw/branch/main/assets/bunny_net.jpg","description":"Flush URLs out of BunnyCDN\'s Cache.","docs":"<h1>BunnyCDN Cache Purge</h1>\\n<p>This plugin can be used to flush URLs out of the <a href=\\"https://bunny.net/\\">Bunny CDN</a> cache.</p>\\n<p>It also provides rsync so that static sites can be uploaded before flushing</p>\\n<h3>Sample</h3>\\n<pre><code>- name: Publish\\n  image: codeberg.org/bentasker/woodpecker-ci-bunnycdn-cache-flush\\n  pull: true\\n  settings:\\n    LOAD_KEY: \\"y\\"\\n    SSH_KEY:\\n        from_secret: ssh_key\\n    DO_RSYNC: \\"y\\"\\n    RSYNC_REMOTE: root@sitehost.internal:/mnt/sites/bt/\\n    RSYNC_PORT: 2222\\n    RSYNC_SOURCE: public        \\n    # Disable the cache flush\\n    DO_FLUSH: \\"n\\"\\n \\n- name: Flush CDN Cache\\n  image: codeberg.org/bentasker/woodpecker-ci-bunnycdn-cache-flush\\n  settings:\\n    BUNNY_API_KEY:\\n      from_secret: bunny_api_key\\n    FLUSH_URLS: \\"https://www.bentasker.co.uk/* https://www.bentasker.co.uk/\\" \\n</code></pre>\\n<hr>\\n<h3>Settings</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Setting</th>\\n<th>Description</th>\\n<th>Default</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>ALWAYS_FLUSH</code></td>\\n<td>A space seperate list of URLs to flush in addition to those in <code>FLUSH_URLS</code>. This allows you to provide a static list of sitemaps etc even if you\'re calculating the value of <code>FLUSH_URLS</code> dynamically</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>BUNNY_API_KEY</code></td>\\n<td>The API token to authenticate against BunnyCDN\'s API with</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>DEBUG</code></td>\\n<td>Put SSH into verbose mode when rsyncing. Useful if auth is failing</td>\\n<td><code>n</code></td>\\n</tr>\\n<tr>\\n<td><code>DO_FLUSH</code></td>\\n<td>Should we attempt the CDN flush? Setting this to <code>n</code> allows the container image to be used just for rsync</td>\\n<td><code>y</code></td>\\n</tr>\\n<tr>\\n<td><code>DO_RSYNC</code></td>\\n<td>Should we perform a rsync?</td>\\n<td><code>n</code></td>\\n</tr>\\n<tr>\\n<td><code>FLUSH_URLS</code></td>\\n<td>Space seperated list of URLs to flush from the CDN cache</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>LOAD_KEY</code></td>\\n<td>Should we install a SSH key within the container</td>\\n<td><code>n</code></td>\\n</tr>\\n<tr>\\n<td><code>RSYNC_PORT</code></td>\\n<td>The SSH port to connect to when rsyncing</td>\\n<td>22</td>\\n</tr>\\n<tr>\\n<td><code>RSYNC_REMOTE</code></td>\\n<td>The remote to rsync to (should be <code>user@host:/path</code></td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>RSYNC_SOURCE</code></td>\\n<td>The source path to rsync from (for Hugo sites this will be <code>public</code>. For <code>Nikola</code> it\'ll be <code>output</code>)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>SSH_KEY</code></td>\\n<td>If <code>LOAD_KEY</code> is set to <code>y</code> we\'ll write the value of <code>SSH_KEY</code> into <code>~/.ssh/id_rsa</code></td>\\n<td></td>\\n</tr>\\n</tbody></table>\\n","tags":["CDN","Bunny.net","flush"],"author":"bentasker","containerImage":"codeberg.org/bentasker/woodpecker-ci-bunnycdn-cache-flush","containerImageUrl":"https://codeberg.org/bentasker/-/packages/container/woodpecker-ci-bunnycdn-cache-flush/a0b20bd8","verified":false,"iconDataUrl":"data:image/jpeg;base64,"}')}}]);